cmp::PartialOrd::lt.doc:
Tests less than (for `self` and `other`) and is used by the `<` operator.

# Examples

```
assert_eq!(1.0 < 1.0, false);
assert_eq!(1.0 < 2.0, true);
assert_eq!(2.0 < 1.0, false);
```

